function(el,x){
     var dados = x.data;
     var viz = this.viz;

     var dados_total = dados.filter(function(d){
                  return d.PERIODO === "Total";
                })

     var dados_anual = dados.filter(function(d){
                  return d.PERIODO === "Anual";
                })

     var dados_periodo = dados.filter(function(d){
                  return d.PERIODO === "Jan-Nov";
                })

     viz.data(dados_total).timeline(false)


    viz.id({"mute": ["SALDO", "CORRENTE"]})

    viz.ui({"value":[
      {
        "method": function(value){
          if (value == "CO_ANO") {
            viz.data(dados_anual)
              .time({"value": value,
                     "solo": []})
              .timeline(false)
              .x(value)
              .y("VL_FOB")
              .draw();
          } else if (value == "PERIODO2") {
           viz.data(dados_total)
              .time({"value": value,
                     "solo": []})
              .timeline(false)
              .x(value)
              .y("VL_FOB")
              .draw();
        } else {
          viz.data(dados_periodo)
              .time(false)
              .x("PERIODO2")
              .y("VL_FOB")
              .draw();
        }
        },
        "label": "Periodicidade:",
        "type": "toggle",
        "value": [{"Mensal": "PERIODO2"}, {"Anual": "CO_ANO"}, {"Acumulado": "x"}]
      },
      {
        "method": function(value){
          if (value === "1") {
            value = ["EXP", "IMP"];
          } else if (value === "3") {
            value = ["SALDO"];
          } else if (value === "2") {
            value = ["CORRENTE"]
          }
          viz
          .id({"solo": value})
          .draw();
        },
        "label": "Tipo:",
        "type": "toggle",
        "value": [{"Exportação/Importação": "1"}, {"Corrente" : "2"}, {"Saldo": "3"} ]
      },
      {
        "method": function(value){
          if (value === "1") {
            viz.type("line")
               .timeline(false)
               .size(false)
               .draw();

          } else if (value === "2") {
            viz.type("bar")
               .timeline(false)
               .draw();
          }
        },
        "label": "Gráfico:",
        "type": "toggle",
        "value": [{"Linha": "1"}, {"Barras": "2"}]
      }
      ]})
}

